    "ggplot(data = aggregate(total_transaction_revenue ~ custom_value, data, sum)) + \n",
    "    geom_bar(aes(x = custom_value, y = total_transaction_revenue), stat = 'identity', fill = 'blue') + \n",
    "    ggtitle('Total transaction revenue for custom value')\n",
    "\n",
    "ggplot(data = aggregate(total_transaction_revenue ~ custom_value, data, mean)) + \n",
    "    geom_bar(aes(x = custom_value, y = total_transaction_revenue), stat = 'identity', fill = 'blue') + \n",
    "    ggtitle('Average transaction revenue for each custom value')"
   ]
