   "source": [
    "custom_model <- lm(total_transaction_revenue ~ date + visitNumber + device_os + total_hits + total_bounces + total_new_visits + \n",
    "                 total_session_quality_dim + traffic_medium, data = train)\n",
    "custom_model_predictions <- predict(custom_model, test)\n",
    "custom_model_predictions[custom_model_predictions < 0] <- 0\n",
    "summary(custom_model)\n",
    "print(paste('Root Mean Squared Error of Custom Linear Regression Model: ', rmse(test$total_transaction_revenue, custom_model_predictions)))"
   ]
